import {BrowserRouter, Route} from "react-router-dom";
import Main_page from "./components/pages/Main_page";
import Dictionary_page from "./components/pages/Dictionary_page";

function App() {
  return (
    <BrowserRouter>
        <Routes>
      <Route path="/" >
          <Main_page />
        </Route>
        <Route path="/dictionary" >
            <Dictionary_page />
        </Route>
        </Routes>
    </BrowserRouter>
  );
}

export default App;
